text:
Lucunya adalah kak pacar nyadain ini telat bgt guys. Gue rasa pengaruh mecin tuh emang bikin kita slow respon/agak bolot gitu. Dia terbirit-birit nelfon gue pas udah di pintu 1 panik nyariin cemilannya dong -,;

'sayang, ketinggalan cemilanku ada di kita?????'

Orgil \xf0\x9f\x98\xad\xf0\x9f\x98\xad\xf0\x9f\x98\xad"

translated_text:
The funny thing is that my girlfriend came up with this very late, guys. I think the influence of the machine really makes us slow to respond/a bit sluggish. He was frantically calling me when I was at the door and was panicking looking for his snacks -,;

'Honey, did I miss my snacks? Is it with us?????'
Orgil \xf0\x9f\x98\xad\xf0 \x9f\x98\xad\xf0\x9f\x98\xad"

back_translated_text:
Lucunya pacarku telat sekali menyampaikan hal ini, kawan. Menurut saya pengaruh mesin memang membuat kita lambat dalam merespon/agak lesu. Dia dengan panik memanggilku ketika aku sudah di depan pintu dan panik mencari makanan ringannya -,;

'Sayang, apakah aku ketinggalan makanan ringanku? Apakah bersama kita?????'
Orgil \xf0\x9f\x98\xad\xf0 \x9f\x98\xad\xf0\x9f\x98\xad"
